import { IonAlert, IonBackButton, IonButtons, IonHeader, IonLoading, IonPage, IonTitle, IonToolbar } from "@ionic/react";
import React, { useState } from "react";

const Otp: React.FC = () => {
  const [otp, setOtp] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [showError, setShowError] = useState(false);
  const [showLoader, setShowLoader] = useState(false);

  return (
    <IonPage>
      <IonLoading
        cssClass="my-custom-class"
        showBackdrop
        isOpen={showLoader}
        message={"Please wait..."}
      />

      <IonAlert
        isOpen={showError}
        onDidDismiss={() => setShowError(false)}
        header={"Error"}
        subHeader={"Something went wrong."}
        message={errorMessage}
        buttons={["OK"]}
      />
      <IonHeader>
        <IonToolbar color="primary">
          <IonTitle>OTP Validation</IonTitle>
        </IonToolbar>
      </IonHeader>
    </IonPage>
  );
};

export default Otp;
